import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import ListItemText from '@mui/material/ListItemText';
import Avatar from '@mui/material/Avatar';
import CalendarToday from '@mui/icons-material/CalendarToday';
import Divider from '@mui/material/Divider';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import ButtonGroup from '@mui/material/ButtonGroup';
import Grid from '@mui/material/Grid';
import { Box } from '@mui/system';

export default function  DetailsCard(props) {
  return (
    <Box>
    <List
      sx={{
        width: '100%',
        height: '100%',

        bgcolor: 'background.paper',
      }}
    >
        <li>
        <Typography
          sx={{ mt: 0.5, ml: 9 }}
          color="text.secondary"
          display="block"
          variant="caption"
        >
          Details
        </Typography>
      </li>
      <ListItem>
        <Button key="one">One</Button>
        <Grid container spacing={2}>
                <Grid item xs={6} md={6}>
                <ListItemText primary={`ID #`} secondary={`-`} />
                </Grid>
                <Grid item xs={6} md={6}>
                <Box
                        sx={{
                            display: 'flex',
                            flexDirection: 'column',
                            alignItems: 'center',
                            '& > *': {
                            m: 1,
                            },
                        }}
                        >
                        <ButtonGroup size="large" aria-label="large button group">
                            <Button key="one">One</Button>
                            <Button key="two">Two</Button>
                            <Button key="three">Three</Button>
                        </ButtonGroup>
                    </Box>
                </Grid>
        </Grid>
      </ListItem>
      <ListItem>
        <ListItemText primary="Catch Phrase" secondary={`North-`} />
      </ListItem>
      <Divider component="li" variant="inset" />
      <ListItem>
        <ListItemText primary="Museum Phrase" secondary="Jan 7, 2014" />
      </ListItem>
      <Divider component="li" variant="inset" />
      <ListItem>
        <ListItemText primary="Shadow Size" secondary="July 20, 2014" />
      </ListItem>
      <Divider component="li" variant="inset" />
      <ListItem>
        <ListItemText primary="Price Cj" secondary={`North-`} />
      </ListItem>
      <Divider/>
    </List>


    </Box>
  );
}
